function Text() {
    var str = document.querySelector("p").innerHTML;
    var res = str.replace("CodeProject", "<span style='color:red'>CodeProject</span>");
    document.querySelector("p").innerHTML = res;
    return (
        <p>
            Graphic and web design
        </p>
    );
}

export default Text;
